// src/components/Step1.js
import React, { useState } from 'react';
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Label } from "@/components/ui/label";

const Step1 = ({ formData, updateFormData, nextStep, prevStep }) => {
  const [name, setName] = useState(formData.name || '');
  const [email, setEmail] = useState(formData.email || '');
  const [phone, setPhone] = useState(formData.phone || '');
  const [position, setPosition] = useState(formData.position || '');

  const handleSubmit = (e) => {
    e.preventDefault();
    updateFormData({ name, email, phone, position });
    nextStep();
  };

  return (
    <div>
      <div className="mb-8">
        <h2 className="text-3xl font-bold mb-4 text-gray-800">Primary Contact</h2>
        <p className="text-gray-600">
          Please enter the contact information for the primary person who will manage and
          oversee your Audiology Plus onboarding. This contact will have administrative
          access to all aspects of our service and be the person we communicate with most
          frequently.
        </p>
      </div>
      <form onSubmit={handleSubmit} className="space-y-6">
        <div>
          <Label htmlFor="name" className="text-sm font-medium text-gray-700">Primary Contact name</Label>
          <Input
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            className="mt-1 bg-white"
            placeholder="Enter full name"
            required
          />
        </div>
        <div>
          <Label htmlFor="email" className="text-sm font-medium text-gray-700">Primary Contact email</Label>
          <Input
            id="email"
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="mt-1 bg-white"
            placeholder="Enter email address"
            required
          />
        </div>
        <div>
          <Label htmlFor="phone" className="text-sm font-medium text-gray-700">Phone number</Label>
          <Input
            id="phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            className="mt-1 bg-white"
            placeholder="(201) 555-0123"
            required
          />
        </div>
        <div>
          <Label htmlFor="position" className="text-sm font-medium text-gray-700">Position</Label>
          <Input
            id="position"
            value={position}
            onChange={(e) => setPosition(e.target.value)}
            className="mt-1 bg-white"
            placeholder="Enter job title"
            required
          />
        </div>
        <div className="flex justify-between pt-4">
          <Button type="button" onClick={prevStep} variant="outline" className="bg-white">Prev</Button>
          <Button type="submit" className="bg-blue-600 hover:bg-blue-700 text-white">Next</Button>
        </div>
      </form>
    </div>
  );
};

export default Step1;
